import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          EUROS
          <button>
            aumentar
          </button>
          <button>
            disminiuir
          </button>
          <div></div>
          
        </div>
      </header>
    </div>
  );
}

export default App;
